  try {
    const refreshTokenId = token.split("::")[0];

    const isValid = user.refreshTokens.find(
      refreshToken => refreshToken._id.toString() === refreshTokenId.toString()
    );

    return !!isValid;
  } catch (err) {
    throw new AppError(err.message);
  }
};

export default {
  sign,
  createAccessToken,
  createRefreshToken,
//  addRefreshTokenUser,
