    if (user.refreshTokens.length >= config.countTokenLimit) {
      user.refreshTokens = [];
    }

    const objectId = mongoose.Types.ObjectId();
    user.refreshTokens.push({ _id: objectId, token });
    await user.save();

    return `${objectId}::${token}`;
  } catch (err) {
    throw new AppError(err.message);
  }
};
